  return (

    <div style={{backgroundColor:"whitesmoke", color:"#636363"}} className=" flex flex-col items-center "
      id="CurrentProjects">
        <h1 className = "font-bold mx-10 my-5">Current Projects</h1>
      <ProjectComponent
        specialid="1"
