      </ProjectComponent>
      <ProjectComponent
        specialid="2"
        title="project 1"
        text="Body of project 2. My name is daniel blah b"
      ></ProjectComponent>
      <ProjectComponent
        specialid="3"
        title="project 1"
        text="Body of project 3. My name is daniel blah b"
      ></ProjectComponent>

    </div>

  );
}

export default CurrentProjects;
